import React from 'react'
import { connect } from 'react-redux'
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend } from 'recharts'

const data = [
      {name: '', light: '', rem: 2400, wake: 2000, deep: 1000, amt: 2400},
      {name: '', light: '', rem: 2400, wake: 2000, deep: 1000, amt: 2210},
      {name: '', light: '', rem: 2400, wake: 2000, deep: 1000, amt: 2290},
      {name: '12', light: '', rem: 2400, wake: 2000, deep: 1000, amt: 2000},
      {name: '5', light: '', rem: 2400, wake: 2000, deep: 1000, amt: 2181},
      {name: '6', light: '', rem: 2400, wake: 2000, deep: 1000, amt: 2500},
      {name: '9', light: '', rem: 2400, wake: 2000, deep: 1000, amt: 2100},
]

class LineGraph extends React.Component {
  render() {

    console.log(this.props.sleep)

  	return (
    	<LineChart width={700} height={300} data={data}
            margin={{top: 5, right: 30, left: 20, bottom: 5}}>
       <XAxis dataKey='name'/>
       <YAxis/>
       <CartesianGrid strokeDasharray="3 3"/>
       <Tooltip/>
       <Legend verticalAlign="top" height={36}/>
       <Line name="light" type="monotone" dataKey="light" stroke="#8884d8" />
       <Line name="rem" type="monotone" dataKey="rem" stroke="#82ca9d" />
       <Line name="wake" type="monotone" dataKey="wake" stroke='rgba(255,163,0)' />
       <Line name="deep" type="monotone" dataKey="deep" stroke='rgba(245,40,0)' />

      </LineChart>
    )
  }
}

const mapStateToProps = (state) => {
  return {
    sleep: state.user.sleep
  }
}

export default connect(mapStateToProps)(LineGraph)
